                <script>
                    if(navigator.userAgent.match(/Android|webOS|iPhone|iPad|iPod|Blackberry/i)){
                        document.getElementById("share-info").style.display = 'none';
                        document.getElementById("logo-area").style.width = "50%";
                        document.getElementById("logo-area").style.paddingRight = document.getElementById("logo-area").style.marginLeft = document.getElementById("logo-area").style.marginRight = "1%";
                        document.getElementById("LOGOSVG").setAttribute("width","100%");
                    }
                </script>
                <script>
                var UA=window.navigator.userAgent;
                var ua=(UA.indexOf('rv:11')+UA.indexOf('Firefox'))>=0;
                if(UA.indexOf('Mobile')>=0){
                    document.getElementById('zoom').style.display='none';
                }
                var svgs = document.getElementById("svg-container").children[0];
                var svgcount = svgs.children.length;
                var maxcount;
                var styleArr = [];
                var heightArr=[];
                var navBar = document.getElementById('navBar');
                var conInfo = document.getElementById('header');
                for (var i = 1; i < svgcount; i++) {
                    styleArr[i] = {width: svgs.getAttribute('width'), height: svgs.getAttribute('height')};
                }

                function max() {
                    var maxx=[];
                    for (var i = 1; i < svgcount; i++) {
                        maxx[i] = svgs.children[i].clientWidth||svgs.children[i].getBoundingClientRect().width;
                    };
                    var maxcount = Math.max.apply(null, maxx);
                    return maxcount+5;
                }
                function zoom() {
                    recontainstyle();
                    var value=document.getElementById('zoomBar').value;
                    var innerSvg=document.querySelectorAll('#svg-container >svg');
                    var perc=parseInt(value*100)+'%';
                    if(value>1) {
                        document.getElementById('svg-container').style.transformOrigin='50% 0';
                        document.getElementById('svg').style.overflowY='auto';
                        document.getElementById('svg-container').style.marginLeft=maxcount*(value-1)/2+'px';
                        document.getElementById('svg-container').style.transform = 'scale(' + value + ')';
                        document.getElementById('svg').style.width=maxcount*value+'px';
                        document.getElementById('svg').scrollLeft=(document.getElementById('svg').scrollWidth-document.getElementById('svg').clientWidth)/2;
                    }else{
                        document.getElementById('svg').style.width="100%";
                        document.getElementById('svg-container').style.marginLeft=0+'px';
                        document.getElementById('svg-container').style.transform='scale(1)';
                        document.getElementById('svg').scrollLeft=0;
                        // document.getElementById('svg-container').style.transformOrigin='50% 0%';
                        // document.getElementById('svg').style.overflowY='hidden';
                        // document.getElementById('svg-container').style.transform = 'scale(' + value + ')';
                        for(var i=0;i<innerSvg.length;i++){
                            if(innerSvg[i].getAttribute('width')){
                                innerSvg[i].setAttribute('width',styleArr[i+1].width*value);
                                innerSvg[i].setAttribute('height',styleArr[i+1].height*value);
                            }else{
                                // innerSvg[i].style.maxHeight='auto';
                                // innerSvg[i].style.height='auto';
                                innerSvg[i].style.maxWidth=perc;
                                // innerSvg[i].style.height=styleArr[i].height/styleArr[i].width
                            }
                        }
                        document.getElementById('svg-container').style.margin='0 auto'
                    }
                    document.getElementById('svg').style.height=document.getElementById('svg-container').getBoundingClientRect().height+25+'px';
                    recontainstyle();
                    document.getElementById('zoomBar').title= parseInt(value*100)+'%';
                }
                document.getElementById('zoomBar').addEventListener((UA.indexOf('rv:11')+UA.indexOf('MSIE'))>=0?'change':'input',zoom);
                document.getElementById('content').addEventListener('transitionend',function () {
                    var zoom=document.getElementById('zoomBar').value;
                    recontainstyle();
                    if(zoom!=1){
                        document.getElementById('svg').style.height=document.getElementById('svg-container').getBoundingClientRect().height+25+'px';
                    }
                    maxcount=max();
                });
                document.getElementById('navButton').addEventListener('click',toggleNav);
                function toggleNav() {
                    var navWidth=document.getElementById('navBar').clientWidth+'px';
                    document.getElementById('navBar').style.right=document.getElementById('navBar').style.right==='-'+navWidth?0:'-'+navWidth;
                    document.getElementById('content').classList.toggle('svgls');
                };
                window.onresize = function () {
                    renavstyle();
                    resvgstyle();
                    maxcount=max();
                    zoom();
                };
                window.onscroll = renavstyle;
                function recontainstyle() {
                    var zoom=document.getElementById('zoomBar').value;
                    if(zoom!=1){
                        document.getElementById('svg').style.height=document.getElementById('svg-container').getBoundingClientRect().height+25+'px';
                    }
                    for (var i = 1; i < svgcount; i++) {
                        heightArr[i]=svgs.children[i].getBoundingClientRect().height+10;
                    }
                    var topHeight = conInfo.clientHeight;
                    if (document.getElementById('svg').clientHeight+document.getElementById('disclaimer').clientHeight+document.getElementById('ac-container').clientHeight+topHeight+43<=window.innerHeight) {
                        document.getElementById('content').style.height=window.innerHeight-topHeight-10+'px';
                    }else{
                        document.getElementById('content').style.height='auto';
                    }
                }
                function resvgstyle() {
                    var sideWidth = navBar.offsetWidth + 20;
                    var oriWidth = styleArr[i].width;
                    var oriHeight = styleArr[i].height;
                    var percent = oriHeight / oriWidth;
                    var innerWidth = document.body.offsetWidth - sideWidth;
                    if (innerWidth <= oriWidth) {
                        svgs.removeAttribute('width');
                        svgs.removeAttribute('height');
                        if (ua) {
                            svgs.setAttribute('height', innerWidth * percent);
                        }
                    } else {
                        svgs.setAttribute('width', oriWidth);
                        svgs.setAttribute('height', oriHeight);
                    }
                    recontainstyle();
                }
                function renavstyle() {
                    var topHeight = conInfo.clientHeight;
                    var scrollTop = document.body.scrollTop || document.documentElement.scrollTop;
                    if (scrollTop > topHeight) {
                        document.getElementById('navBar').style.top = 0 + 'px';
                    } else {
                        document.getElementById('navBar').style.top = topHeight - scrollTop + 'px';
                    }
                    doscroll();
                }
                function doscroll() {
                    var topHeight=conInfo.clientHeight;
                    var scrollTop=document.body.scrollTop||document.documentElement.scrollTop;
                    for(var i=1;i<svgcount;i++){
                        var sum=0;
                        for(var j=1;j<=i;j++){
                            sum+=heightArr[j];
                        }
                        if(scrollTop+window.innerHeight/2-topHeight-10-sum<0){
                            var sub=Number(i);
                            if(document.querySelector('#nav-thumbs .selected')){
                                document.querySelector('#nav-thumbs .selected').classList.remove('selected');
                            }
                            document.querySelector('.nav-thumb:nth-of-type('+sub+')').classList.add('selected');
                            break;
                        }
                    }
                    if(!document.getElementsByClassName('selected').length){
                        document.getElementsByClassName('nav-thumb')[0].classList.add('selected');
                    }
                }
                var navs=document.querySelectorAll('.nav-thumb');
                for(var i=0;i<navs.length;i++){
                    navs[i].children[0].children[1].onclick=function () {
                        document.querySelector('#nav-thumbs .selected').classList.remove('selected');
                        this.parentNode.classList.add('selected');
                    }
                }
                if(UA.indexOf('Mobile')>=0){
                    document.getElementById('navButton').click();
                }
                renavstyle();
                resvgstyle();
                doscroll();
                var sideWidth = navBar.offsetWidth;
                document.getElementById('content').style.marginRight = sideWidth + 'px';
                recontainstyle();
                
                </script>
